values:
wooo i turned eighteen yesterday, or more like 5 hours ago, but i didn't do anything ridiculous like buy porn or a lottery ticket or cigarettes.&nbsp; i wish i did though. oh well i have the rest of my life to do it.

it's like freakin 4:55 and i can't sleep because i'm so flippin excited for my grad party.&nbsp; either that or i ate way too much chocolate cake.&nbsp;&nbsp;

my fourth of july was so freakin crazy.&nbsp; i think i lost 3 years of my life span from all the shit that got me really messed up.&nbsp;&nbsp;

these 5 days are gonna be ridiculous.
